.logo{position:absolute;left:0;right:0;margin:16.66vh auto 0;width:290px
}
@media (min-width: 360px){
.logo{width:320px
}
}
@media (min-width: 432px){
.logo{width:390px
}
}
@media (min-width: 576px){
.logo{width:495px
}
}
@media (min-width: 768px){
.logo{width:635px
}
}
.actions{text-align:center;margin-top:35px
}
@media (min-width: 432px){
.actions{margin-top:40px
}
}
@media (min-width: 576px){
.actions{margin-top:45px
}
}
@media (min-width: 768px){
.actions{margin-top:50px
}
}
.apply-btn{color:white;background-color:#222a53;border-radius:2px;text-decoration:none;padding:15px 45px;font-weight:bold;-webkit-transition:all 0.25s;-o-transition:all 0.25s;transition:all 0.25s;-webkit-tap-highlight-color:transparent
}
.apply-btn:hover,.apply-btn:focus{background-color:#394574
}
.apply-btn:active{background-color:#13182f
}
.batman-building{position:absolute;left:0;right:0;margin:35vh auto 0;max-width:256px;-webkit-filter:drop-shadow(0 50px 25px rgba(255,255,255,0.66));filter:drop-shadow(0 50px 25px rgba(255,255,255,0.66))
}
@media (min-width: 432px){
.batman-building{max-width:360px
}
}
